import React, { Component } from 'react';
import "./YearMain.css"

class YearMain extends Component {


  render() {
    let ctx = document.getElementById("myChart").getContext('2d');
    return (
      <div>
        <div> Year GraphJS </div>
        <canvas id="myChart"></canvas>
      </div>
    );
  }
}

export default YearMain;
